import React from 'react';
export default function Sign_In(){
    return (
        
        <>
        <style>{'body{background:linear-gradient(to right, #c0c0aa, #1cefff);}'}</style>
   
    <div class="form-signin">
    <i class="fas fa-user-plus fa-7x"></i><h1 class="h3 mb-3 font-weight-normal">Please sign in</h1>
      <label for="inputEmail" class="sr-only">Email address</label>
      <input type="email" id="inputEmail" class="form-control" placeholder="Email address" required autofocus/>
      <label for="inputPassword" class="sr-only">Password</label>
      <input type="password" id="inputPassword" class="form-control" placeholder="Password" required/>
      
        
          <input type="checkbox" value="remember-me"/> Remember me&nbsp;&nbsp;
        
      
      <button class="ml-2 btn btn-lg btn-primary btn-block" type="submit">Sign in</button>
      <p class="mt-5 mb-3 text-muted">Don't Have a account?</p><a class="btn btn-outline-primary" href="/sign-Up">Sign Up</a>
    
  </div>
        </>
    )
}
